import React from "react";
import { Title } from "../Components/Title";
import Profile from "../assets/pruebaperfil.jpg";
import "../styles/AboutMe.css";

function AboutMe() {
  return (
    <>
      <div className="container">
        <Title title="About Me" />
        <section className="content">
          <div className="img-container">
            <img src={Profile} alt="Profile Photo" />
          </div>
          <div className="description-container">
            <p>
              Lorem ipsum dolor sit amet consectetur adipisicing elit. Corrupti
              delectus molestias ipsam iure voluptatibus perferendis aspernatur
              laudantium eveniet, quaerat exercitationem alias enim harum quae
              nemo consequuntur excepturi est magnam labore?
            </p>
          </div>
        </section>
      </div>
    </>
  );
}

export { AboutMe };
